// PDF导出分页  判断封闭

var pdfTitle="data:image/png;base64,";
var pdfFoot = "data:image/png;base64,";
document.getElementById("exportPDF1").onclick=function(){
	$(".yemei").hide();
	$(".yejiao").hide();

	if($(".hidePdf1 .pdf_one_tr").length ==3){
		 $(".hidePdf1 .notes").css("lineHeight","47px");
	}	
	else if($(".hidePdf1 .pdf_one_tr").length ==6){
		$(".hidePdf1 .Comments").css("marginBottom","20px");
	}
	else if($(".hidePdf1 .pdf_one_tr").length ==8){
		 $(".hidePdf1 .Comments").parent().prev().css("marginBottom","80px");
	}
	var target = document.getElementById("CompleteMachineChina");
	var width = $('#CompleteMachineChina').width() ; 
	var height =  $('#CompleteMachineChina').height() ;
	
	var canvas = document.createElement("canvas");  
	    canvas.width = width * 2;  
	    canvas.height = height * 2;  
	    canvas.style.width = width + "px";  
	    canvas.style.height = height + "px";  
	var context = canvas.getContext("2d");//然后将画布缩放，将图像放大两倍画到画布上  
	    context.scale(2,2);   
	    html2canvas(target, {
			canvas:canvas,
			  onrendered:function(canvas) {

			      var contentWidth = canvas.width;
			      var contentHeight = canvas.height;

			      //一页pdf显示html页面生成的canvas高度;
			      var pageHeight = contentWidth / 592.28 *650;
			      //未生成pdf的html页面高度
			      var leftHeight = contentHeight;
			      //页面偏移
			      var position = 0;
			      //a4纸的尺寸[595.28,841.89]，html页面生成的canvas在pdf中图片的宽高
			      var imgWidth = 595.28;
			      var imgHeight = 600/contentWidth * contentHeight;
			
			      console.log(contentHeight)
			      console.log(contentWidth)
				console.log(imgHeight)
			      var pageData = canvas.toDataURL('image/png', 1.0);
			      var pdf = new jsPDF('', 'pt', 'a4');
			      //有两个高度需要区分，一个是html页面的实际高度，和生成pdf的页面高度(841.89)
			      //当内容未超过pdf一页显示的范围，无需分页
			      if (leftHeight < pageHeight) {
			    	  pdf.addImage(pageData, 'PNG', 0,position+80, 600, imgHeight);
			          pdf.addImage(pdfTitle, 'JPG', 0, 0, 600,90);  
			          pdf.addImage(pdfFoot, 'JPG', 0, 741.89, 600,100);  
			      } 
			      else {
			          while(leftHeight > 0) {
			        		  pdf.addImage(pageData, 'PNG', 0,position+80, 600, imgHeight);
	    			          pdf.addImage(pdfTitle, 'JPG', 0, 0, 600,90); 
	    			          pdf.addImage(pdfFoot, 'JPG', 0, 741.89, 600,100);  
				              leftHeight -= pageHeight;
				              position -= 655;
			              //避免添加空白页
			              if(leftHeight > 0) {
			                pdf.addPage();
			              }
			          }
			      }
			      pdf.save('CompleteMachineRMB.pdf');
			  }
		})
	}

